import React, { useEffect, useState } from 'react'
import HelpAndTips from '../../components/molecules/HelpAndTips'
import Jumbotron from '../../components/molecules/Jumbotron'
import QouteSection from '../../components/molecules/QouteSection'
import Testimoni from '../../components/molecules/Testimoni'

const LandingPage = () => {
  const [testimonial, setTestimonial] = useState([])
  const [helpAndTips, setHelpAndTips] = useState([])

  useEffect(() => {
    fetch('https://wknd-take-home-challenge-api.herokuapp.com/testimonial')
      .then((res) => res.json())
      .then((data) => {
        setTestimonial(data)
      })

    fetch('https://wknd-take-home-challenge-api.herokuapp.com/help-tips')
      .then((res) => res.json())
      .then((data) => {
        setHelpAndTips(data)
      })
  }, [])

  return <div></div>
}

export default LandingPage
